INSERT INTO `animals` VALUES (134,'01,41,81','ປານ້ອຍ','Small Fish','ຝັນເຫັນ ປານ້ອຍ,ຊາຍງາມ,ເຂົ້າເປືອກ ເຂົ້າສານ,ຂື້ນໂຮງ,ຂື້ນສານ,ຜິດຖຽງກັນ, ຄູບາອາຈານ,ສາວນ້ອຍຟ້ອນງາມ,ເຫັນມັງກອນ, ນົກເຕັ້ນ,ເຫັນເຈົ້ານາຍໃຫ່ຍ','3,7,8,5,6,9,0,1,4'),(135,'02,42,82','ຫອຍ','Snail','ຝັນເຫັນຫອຍ ເກັບໄດ້ເງິນຫຼຽນ, ເກັບດອກໄມ້ໃນສວນ,ຍິງຊາຍກອດກັນ, ຈູບປາກ,ກິນໄຂ່,ເປັນຝີ,ເປັນຕຸ່ມ,ໄດ້ຕຸ້ມຫູ, ດ້າວຕົກເຕັມໄຮ່ນາ,ໝາກເຫັບຕົກ, ຫຼີ້ນລະຄອນງ້ຽວກັນ,ຫຼີ້ນໝາກລຸກ','0,2,6,9,1,4,5,3'),(136,'03,43,83','ຫ່ານ','Goose','ຝັນຝັນເຫັນ ໄກ່,ເປັດ,ໂຮງຜີ,ແຮ່ສົບ, ນາງພະລາຊະນີຂາຍເຫຼົ້າ,ປ່ອຍນົກ,ເຈົ້າສາວ, ນົກຫົງ,ໂຕຫ່ານ,ເຫັນແມ່ຊີ,ນາຍທະຫານ, ຄວາຍດ່ອນກິນຫຍ້າຢູ່ເດີ່ນ,ຕັ້ງສານເຈົ້າເຫັນ ປານ້ອຍ,ຊາຍງາມ,ເຂົ້າເປືອກ ເຂົ້າສານ,ຂື້ນໂຮງ,ຂື້ນສານ,ຜິດຖຽງກັນ, ຄູບາອາຈານ,ສາວນ້ອຍຟ້ອນງາມ,ເຫັນມັງກອນ, ນົກເຕັ້ນ,ເຫັນເຈົ້ານາຍໃຫ່ຍ','1,3,4,7,0,2,6,8,9'),(137,'04,44,84','ນົກຍູງ','Peacock','ຝັນເຫັນ ນົກຍຸງ,ຄົນໄຖນາ,ດອກໄມ້ງາມ, ຝັນເຫັນເປັດ, ໄດ້ສິ້ນໄໝ, ເຫັນຫ່ານ, ນາງສາວແຕ່ງງານໄດ້ນຸ່ງຊຸດໄໝ ຜົວເມຍນອນນຳກັນ, ໄກ່ຟ້າ','3,6,7,0,5,9'),(138,'05,45,85','ສິງ','Lion','ຝັນເຫັນ ສິງໂຕ,ແສງຈັນຢູ່ທ້ອງຟ້າ,ໝູ່ໂຈນ, ໜ້າແດງ,ຜູ້ຊາຍຜົມຍາວລຸງລັງ,ເຫັນອົງລືສີ, ຜູ້ຊາຍໜວດຍາວ,ສອບເສັງ,ຕິດປະກາດມີຄະແນນຫຼາຍ','3,7,9,2,5,8,0'),(139,'06,46,86','ເສືອ','Tiger','ຝັນເຫັນ ເສືອ,ຕາເວັນຂື້ນ,ພູເຂົາໄຟລະເບີດ, ໂຈນປຸ້ນ,ງົວຄວາຍກິນຫຍ້າ,ເສືອນອນເວັນ, ການລົບລາຂ້າຟັນ,ກິນຊີ້ນດິບ','0,3,4,6,1,7,9,2'),(140,'07,47,87','ໝູ','Pig','ຝັນເຫັນ ໝູ,ເຮືອດິນແມ່ນ້ຳ,ຄົນຕົກນໍ້າ, ໝູກິນຮຳ,ໄດ້ລ້ຽງລູກຊ້າງ,ໄດ້ກິນຫົວເຜືອກ','3,6,8,9,0,2,5,7'),(141,'08,48,88','ກະຕ່າຍ','Rabbit','ຝັນເຫັນ ກະຕ່າຍ,ດວງຈັນ,ໄຂ່ໄກ່, ຕົກສະຫວັນຊັ້ນຟ້າ,ຍິງປະໂປ້,ນາຍທະຫານ, ໝູກິນຫຍ້າອອ່ນ,ລູກເສືອຢອກກັນ, ຄືນເດືອນແຈ້ງ','3,5,8,1,4'),(142,'09,49,89','ຄວາຍ','Buffalo','ຝັນເຫັນ ງົວ,ຄວາຍ,ມ້າ, ໄຟໄໝ້ປ່າ, ຝູງທະຫານລາຍ, ໄຟໄໝ້ພູເຂົາ, ໂຮງສົບຄົນຕາຍນາຍທະຫານ,ນາຍຕຳຫຼວດ, ກະທິງໄລ່ຊົນ,ປູ່ຍ່າມາຢາມ','2,6,7,8,3,4,5'),(143,'10,50,90','ນາກນ້ຳ','Water Dragon','ຝັນເຫັນ ນາກນໍ້າ,ນັ່ງເຮືອຈັກ,ສັດທະເລ, ມັງກອນ,ໄປທະເລ,ແມວນ້ຳສະແດງ, ແມວນ້ຳກິນປາ, ໄຫຼມອງ,ເຕົ່າທະເລ, ໜູລອຍນ້ຳ','2,3,5,6,1,9,0,4'),(144,'11,51,91','ໝາ','Dog','ຝັນເຫັນ ໝາ,ເສືອ,ຮ້ອງໃຫ້ເຮັດນາ,ຍິງ, ໄດ້ລູກນ້ອຍ,ຍິງຮ້ອງໃຫ້,ຮ່ວມເພດ,ຊາຍປະໂປ້, ເດັກນ້ອຍກິນອາຫານກິນເປື້ອນ','5,6,7,0,3,4,9,1,8'),(145,'12,52,92','ມ້າ','Horse','ຝັນເຫັນ ມ້າ, ໄຟໄໝ້,ແສງແດດ,ຟາມງົວ, ນຸ່ງຊຸດຄາວບອຍ,ຂີ່ລົດມ້າບູຮານ, ເດັກນ້ອຍແລ່ນຫຼີ້ນ,ໝໍດູ,ຄວາຍນອນເວັນ','0,3,4,1,4,7,2'),(146,'13,53,93','ຊ້າງ','Elephant','ຝັນເຫັນ ຊ້າງ,ພໍ່ຄ້າໃຫ່ຍ,ກະປິງ,ຈັບປາ, ຕຶກປາ,ໂຕແຫຼວ,ຄົນຕາຍ,ຄົນຕົກນໍ້າ,ຂີ່ຊ້າງ, ສ້າງບ້ານແປງເມືອງ,ຝັງສົບຄົນຕາຍ,ດິນເຈື່ອນ','0,3,6,7,1,2'),(147,'14,54,94','ແມວບ້ານ','Cat','ຝັນເຫັນ ແມວບ້ານ,ຄົນຂາຍໝູ, ກິນຊີ້ນສັດດິບ,ຂີ້ລັກ,ໝູ,ໝາ,ເດັກນ້ອຍໄຫ້, ລູກເສືອຢອກກັນ,ຫຼີ້ນໝາກລຸກ, ຫຼີ້ນສະນຸກເກີ້','0,2,4,6,3,7,8'),(148,'15,55,95','ໜູ','Rat','ຝັນເຫັນ ໜູ,ຢູ່ເຮືອນຈັບປາ,ນັ່ງໃນເຮືອ, ໝູເຂົ້າມຸ້ງ,ໜູກັດມີນົກນອນຢູ່ໃນໂກນໄມ້, ງານລ້ຽງອາຫານ,ເຫັນຄົນພາຍເຮືອ, ຄົນຫໍເຮືອ,ເຫັນໜູຕາຍຢູ່ໃນເຮືອນດີ','0,5,6,8,0,4,7'),(149,'16,56,96','ເຜິ້ງ','Bee','ຝັນເຫັນ ເຜີ້ງ,ຈອມປວກ,ຄົນຕັດຟືນ, ເຜົາຖ່ານ,ຝົນຕົກ,ເຜີ້ງຕອດ, ໄຟໄໝ້ລາມປ່າ, ສວນດອກໄມ້,ຄົນທຸກ','0,2,4,1,5,3,8'),(150,'17,57,97','ນົກຍາງ','Crane','ຝັນເຫັນ ນົກຍາງ,ນົກຕ່າງໆ,ຝົນຕົກໜັກ, ນັກຮຽນ,ຜູ້ເຖົ້າສັກໄມ້ຄັນເຖົ້າ,ນົກເຈົ່າ, ລ່ອງເຮືອແພ','3,4,7,2,5,8,9,6'),(151,'18,58,98','ແມວປ່າ','Lynx','ຝັນເຫັນ ແມວປ່າ,ແຕ່ງໂຕດຳ,ນຸ່ງຊຸດດຳ, ແມ່ຊີແຕ່ງໂຕ,ເຫັນໂມ້ງດຳ,ເຫັນກະເທີຍ, ຍິງແຕ່ງໂຕເປັນຜູ້ຊາຍ,ກິນອາຫານດຳ, ຄວນໄຟດຳ,ແຂ່ງມ້າ,ຟັງເທດ,ກິນອາຫານເຈ','3,7,8,9,0,2,5,6'),(152,'19,59,99','ແມງກະເບື້ອ','Butterfly','ຝັນເຫັນ ແມງກະເບື້ອ,ຍິງຫວີຜົມ,ຍິງງາມ, ສວນດອກໄມ້,ໄກ່ງວງກິນຫຍ້າ,ເຫັນໜອນ, ໄກ່ງວງກິນຫຍ້າ','0,3,5,4,7,8,6'),(153,'00,20,60','ຂີ້ເຂັບ','ຂີ້ເຂັບ','ຝັນເຫັນ ຂີ້ເຂັບ,ໄດ້ສາຍຄໍຄຳ,ສາຍແຂນ, ແມ່ລູກອອ່ນ,ເພັດນິນຈິນດາ,ຜູ້ສາວງາມ, ເບິ່ງພາບພະຍົນ,ໃສ່ແຫວນເພັດ,ຊາຍງາມ, ໃສ່ມຸງກຸດເພັດ,ດອກໄມ້ສວຍງາມ,ເປັນຂີ້ກາກ','4,6,9,2,5,7,0'),(154,'21,61','ນົກແອ່ນ','Swallow','ຝັນເຫັນ ນົກແອ່ນ,ຝົນຕົກ,ຂຶ້ນຕົ້ນຕານ, ຕົ້ນພ້າວ,ລັດຖະກອນ,ຜູ້ຍິງຟ້ອນອ້ອນ,ຂີ້ມ້າ, ໄດ້ເຫາະ,ໜຸ່ມສາວກ້ຽວກັນ,ຂີ່ເຮືອບິນ, ເຂົ້ານອນໃນຖ້ຳ','5,8,9,0,4'),(155,'22,62','ນົກກາງແກ','Pigeon','ຝັນເຫັນ ນົກກາງແກ,ເອົາລູກກິນນົມ, ກິນຫອຍແຄງ,ຮ້ານຂາຍເຫຼົ້າ,ໄປທ່ຽວປ່າ, ແມ່ຍິງຕຸ້ຍປະໂປ້,ໄດ້ໂດດຈ້ອງ,ເຈົ້ານາຍມາຢາມ, ພົບໝູ່ເກົ່າ','0,4,5,1,3,7'),(156,'23,63','ລິງ','Monkey','ຝັນເຫັນ ລິງ,ທະນີ,ຜີກັດ,ຂຸນນາງ,ຂື້ນແຂວນ ຕົ້ນໄມ້,ລູກກັດນົມ,ເຫັນຜີປອບ,ຄົນເກົ່າບູຮານ, ກິນໝາກໄມ້,ຝັນໄດ້ກິນໝາກກ້ວຍ','0,3,5,9,2,8'),(157,'24,64','ກົບ','Frog','ຝັນເຫັນ ກົບ,ນໍ້າຖ້ວມ,ຄັນຄາກເຂົ້າຮູ, ໂຮງສີເຂົ້າ,ລົງນ້ຳສ້າງ,ລວງສ້າງ,ລອຍນ້ຳ, ຮາກອອກ,ຮ້ອງເພງ,ຝັນກະໂດດ,ຝົນຕົກ, ປີນຕົ້ນໄມ້,ໂດດນໍ້າ','1,5,6,9,3,8'),(158,'25,65','ແຫຼວ','Hawk','ຝັນເຫັນ ໂຕແຫຼວ,ເຫັນຄົນຕາຍ,ໝາກັດ, ເມົາເຫຼົ້າ,ຂີ່ມ້າແລ່ນ,ນົກບິນໄລ່ຕອດກັນ, ນົກກິນລູກນົກ,ຄົນບ້າ,ເລືອດອອກຕາມຫ່ງກາຍ','3,6,9,0,1'),(159,'26,66','ນາກບິນ','Dragon','ຝັນເຫັນ ມັງກອນ,ນາກບິນ,ພູເຂົາໄຟ,ງູໃຫ່ຍ, ແຜ່ນດິນຖະລົ່ມ,ລາດສະບັນລັງ,ພື້ນແຕກ, ງກັດ,ງບິນໄດ້','5,7,8,6,0,1,3'),(160,'27,67','ເຕົ່າ','Turtle','ຝັນເຫັນ ໄກ່ຟ້າ,ໄຟໄໝ້,ໂຮງສົບຜີ,ຈູດລະເບີດ, ຟ້າແມບຟ້າຜ່າ,ປາຝາໃຫ່ຍ,ໃສ່ໝວກກັນນ໋ອກ, ຮ້ອງໄຫ້ມີນ້ຳຕາ','2,6,8,9,5,7'),(161,'28,68','ໄກ່','Chicken','ຝັນເຫັນ ໄກ່,ພະສົງ,ເນນນ້ອຍ,ຮ້ອງເພງ, ໂຄມໄຟ, ໄດ້ຕຳແໜ່ງ, ໄດ້ເປົ່າປີ່,ຕີກອງ, ໄກ່ນ້ອຍຕີກັນ','0,4,5,8,2,9'),(162,'29,69','ອ່ຽນ','eel','ຝັນເຫັນ ອ່ຽນ,ຝັນວ່າໄດ້ປາດຸກ,ລົງຕົມ,ຕົກສ້າງ, ນັກບວດ,ປາໄຫຼ,ໄດ້ພົບໝໍ,ເຫັນງູ,ຕີມີດ, ເຜົາເຫຼັກ','0,3,4,5,1,2,8,9'),(163,'30,70','ປາໃຫຍ່','Big Fish','ຝັນເຫັນ ປາໃຫ່ຍ,ຊາຍງາມ,ຄົນຕາຍໃນບໍ່ນ້ຳ, ຕັດໄມ້,ເຫັນເຕົ່າໃນນ້ຳ,ກຳມະກອນ,ຂ້າຟັນກັນ, ເຫັນກຳປັ່ນໃຫ່ຍ,ຂອນໄມ້ຢູ່ກາງນ້ຳ','4,5,6,8,2'),(164,'31,71','ກຸ້ງ','Shrimp','ຝັນເຫັນ ກຸ້ງ,ກິນກຸ້ງ,ລິງນ້ອຍ,ໝານ້ອຍ, ເຫັນຄົນພິການ,ນາງຊະນີຂາວ,ສາວໄໝເງິນ, ເຫັນປີສາດ,ຕຶກກະດຸ້ງ','0,5,7,6,2,3,4,8'),(165,'32,72','ງູ','Snake','ຝັນເຫັນ ງູ,ຂີ້ກະເດືອນ,ແມງງວດ,ແມ່ບ້ານ, ຈ່າຍເງິນຫຼາຍ,ຜູ້ສາວກອດ,ເສດຖີເງິນລ້ານ, ໄດ້ວັດຖຸມີຄ່າ, ໄດ້ພົບເຫັນຄົນຮັກເກົ່າ','3,4,6,8,9'),(166,'33,73','ແມງມຸມ','Spider','ຝັນເຫັນ ແມງມຸມ,ເຮືອນຮ້າງ, ໄຫຼມອງ, ເຄື່ອງບູຮານ,ຄົນແຕ່ງໂຕດ້ວຍເສື້ອຂາດ, ນັກໂທດ','1,4,5,3,7,6'),(167,'34,74','ກວາງ','Deer','ຝັນເຫັນ ກວາງ,ແບ້,ໂອ່ງ,ມັ່ງ,ຮ່ານ, ໄດ້ສິ່ງຂອງມີຄ່າ,ເປັນວັດຖຸມຸງຄຸນ, ຝັນເຫັນຄວາຍ, ທຸກຍາກລໍາບາກ','0,2,4,8,7,9'),(168,'35,75','ແບ້','Goat','ຝັນເຫັນ ແບ້, ໂຕເຍືອງ,ອຸດຈະລະສັດ, ແກະຊົນກັນ,ຄົນຂີ້ທູດ','2,6,7,8,0,4'),(169,'36,76','ເຫງັນ','raccoon','ຝັນເຫັນ ເຫງັນ,ເຫັນຄົນຂໍທານ,ໝາໄລ່ກັດ, ໂຮງຂ້າສັດ,ຂີ້ລັກເລັກຂະໂມຍນ້ອຍ,ອຸ້ມລູກໜີ, ໄດ້ຈັບລູກໝາດໍາ,ເຫັນນົກເຄົ້າ','6,7,9,3,0,4,8'),(170,'37,77','ຫຼິ່ນ','Pangolins','ຝັນເຫັນ ຫຼິ່ນ,ໄດ້ລາງວັນ,ເຫັນແມ່ທັບ, ເຫັນເສດຖີ,ຫຼີ້ນການພະນັນ,ຫຼີ້ນກາ ເກັບໄດ້ເງິນຄໍາ,ໄດ້ຊັບສົມບັດ','0,4,8,2,3,6,9'),(171,'38,78','ເໝັ້ນ','hedgehog','ຝັນເຫັນ ເໝັ້ນ,ຜູ້ຮັກສາສົມບັດ,ເຈົ້າປ່າ, ເຈົ້າພູເຂົາ,ເຈົ້າຂອງເຮືອນ,ຜູ້ສັກສິດ, ໄດ້ເປັນອົງຄະລັກຜູ້ໃຫ່ຍ,ພະລາຊາ, ເຈົ້າຊີວິດ,ຫົວໜ້າຊົນເຜົ່າ','0,1,5,6,4,7'),(172,'39,79','ກະປູ','Crab','ຝັນເຫັນ ກະປູ,ມ້າແລ່ນ,ໜາມຂູດໂຕ,ຂີ່ລົດຖັງ, ແຂ້ວຫັກ,ແຂ້ວຄ່ອນ,ເລັບມືໜັກ,ບໍ່ໃສ່ເກີບ','0,2,5,7,4,8,9'),(173,'40,80','ນົກອິນຊີ','Eagle','ຝັນເຫັນ ນົກອິນຊີ,ຄົນເສຍອົງຄະ,ຄົນຂີ້ເຫຼົ້າ, ເລືອດອອກ,ອິນຊີໄດ້ຄາບສັດ,ນົກຮຸ້ງຄາບງ, ຝັນໄດ້ເຫາະ,ເປັນພະຍາ','2,6,7,9,1,4');
