DROP TABLE IF EXISTS `lotto_bill_histories`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lotto_bill_histories` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `created_at` datetime(3) DEFAULT NULL,
  `updated_at` datetime(3) DEFAULT NULL,
  `deleted_at` datetime(3) DEFAULT NULL,
  `bill_number` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci,
  `buy_time` datetime(3) DEFAULT NULL,
  `security_code` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci,
  `total_amount` bigint DEFAULT NULL,
  `lotto_draw_id` bigint unsigned DEFAULT NULL,
  `buy_type_id` bigint unsigned DEFAULT NULL,
  `lotto_bill_status_id` bigint unsigned DEFAULT NULL,
  `created_by` bigint unsigned DEFAULT NULL,
  `updated_by` bigint unsigned DEFAULT NULL,
  `lat` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci,
  `lng` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci,
  `expire_time` datetime(3) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `digital_signature` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci,
  `lotto_transaction` longtext,
  `request_id` longtext,
  `re_new_id` bigint unsigned DEFAULT NULL,
  `current_commission` double DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `deleted_at` (`deleted_at`) USING BTREE,
  KEY `lotto_bill_status_id` (`lotto_bill_status_id`) USING BTREE,
  KEY `lotto_draw_id` (`lotto_draw_id`) USING BTREE,
  KEY `idx_lotto_bill_histories_deleted_at` (`deleted_at`) USING BTREE,
  CONSTRAINT `fk_lotto_bill_histories_lotto_bill_status` FOREIGN KEY (`lotto_bill_status_id`) REFERENCES `lotto_bill_statuses` (`id`),
  CONSTRAINT `fk_lotto_bill_histories_lotto_draw` FOREIGN KEY (`lotto_draw_id`) REFERENCES `lotto_draws` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_lotto_draws_lotto_bill_histories` FOREIGN KEY (`lotto_draw_id`) REFERENCES `lotto_draws` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `lotto_bill_histories_ibfk_1` FOREIGN KEY (`lotto_bill_status_id`) REFERENCES `lotto_bill_statuses` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `lotto_bill_histories_ibfk_2` FOREIGN KEY (`lotto_draw_id`) REFERENCES `lotto_draws` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `lotto_bill_histories_ibfk_3` FOREIGN KEY (`lotto_draw_id`) REFERENCES `lotto_draws` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=309 DEFAULT CHARSET=utf8mb3;
