 )
BEGIN
/****************************************************************
* sp_aggregate_app_daily_sale
*  create by sy.park
*  create at 2023.07.18
*  batch time : every day 00h:00m:05s
*****************************************************************/
declare  v_lot_id    varchar(10);
declare  v_is_cnt    integer default 0;
declare  v_ok_cnt1   integer default 0;
declare  v_ok_cnt2   integer default 0;
declare  v_fail_cnt  integer default 0;
declare  v_proc_id   varchar(50); 
declare  v_step      varchar(10);
declare  sql_err     int default 0;
declare  v_date      date;
declare  v_remark    varchar(200);
declare  v_bf_date   date;

declare continue handler for sqlexception set sql_err = -1;

 set  v_proc_id = 'sp_aggregate_app_daily_sale';
 set  v_step    = 'Start';
 set  v_remark  = concat(arg_date,'[1-1] create a app sale aggregate ');
 set  v_bf_date = adddate(current_date(), interval 1 day);
 set  v_date    = ifnull(str_to_date(arg_date,'%Y%m%d'),v_bf_date);

proc_return: begin  

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
       (null, v_proc_id, CURRENT_DATE(), v_step,
          v_ok_cnt1, v_fail_cnt,     v_remark,  current_timestamp()
       );
      
/**********************************
 * 1. app_daily aggregation 
 * *********************************/
select count(*) 
into   v_is_cnt
from   aggregate_app_sale 
where  aggregate_date = v_date
;
if v_is_cnt > 0 then 
   delete from aggregate_app_sale 
   where  aggregate_date = v_date
   ;
 set  v_ok_cnt1 = row_count();
 set  v_step    = 'Delete';
 set  v_remark  = concat(arg_date,'[1-2] Delete old aggregate_app_sale');
 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
       (null, v_proc_id, CURRENT_DATE(), v_step,
          v_ok_cnt1, v_fail_cnt,     v_remark,  current_timestamp()
       );

  end if    
   ;
 
insert into aggregate_app_sale 
		(lot_id           , 
		 aggregate_date    ,   
		 total_qty   ,
		 total_amt   ,
		 digit_2_qty ,
		 digit_2_amt ,
		 digit_3_qty ,
		 digit_3_amt ,
		 digit_4_qty ,
		 digit_4_amt ,
		 digit_5_qty ,
		 digit_5_amt ,
		 digit_6_qty ,
		 digit_6_amt ,
		 created_at)  
select   doi.lot_id as LOT_ID   
       , date(ld.created_at) as aggregate_date 
       , sum(ldn.money / 1000) as total_qty 
       , sum(ldn.money)        as total_amt 
       , sum(case when ldn.quota_digit_id = 2 then ldn.money/1000 else 0 end) as digit_2_qty 
       , sum(case when ldn.quota_digit_id = 2 then ldn.money      else 0 end) as digit_2_amt 
       , sum(case when ldn.quota_digit_id = 3 then ldn.money/1000 else 0 end) as digit_3_qty 
       , sum(case when ldn.quota_digit_id = 3 then ldn.money      else 0 end) as digit_3_amt 
       , sum(case when ldn.quota_digit_id = 4 then ldn.money/1000 else 0 end) as digit_4_qty 
       , sum(case when ldn.quota_digit_id = 4 then ldn.money      else 0 end) as digit_4_amt 
       , sum(case when ldn.quota_digit_id = 5 then ldn.money/1000 else 0 end) as digit_5_qty 
       , sum(case when ldn.quota_digit_id = 5 then ldn.money      else 0 end) as digit_5_amt 
       , sum(case when ldn.quota_digit_id = 6 then ldn.money/1000 else 0 end) as digit_6_qty 
       , sum(case when ldn.quota_digit_id = 6 then ldn.money      else 0 end) as digit_6_amt 
from lotto_draws ld 
inner join lotto_bill_histories lbh 
      on   ld.id = lbh.lotto_draw_id 
     /* and  lbh.deleted_at  is null 
      and  lbh.lotto_bill_status_id = 2 */
inner join lotto_draws_numbers ldn 
      on   ld.id = ldn.lotto_draw_id 
      /* and ldn.deleted_at is null
         and ldn.status = 2
       */ 
inner join days_of_installments doi 
      on   doi.id = ld.days_of_installment_id  
inner join installments i 
      on   doi.installment_id = i.id 
where ld.deleted_at  is null
/* and   ld.lotto_draw_status_id  = 2 */
and   ld.created_at  >= v_date 
and   ld.created_at  <  date_add(v_date, interval 1 day )
group by doi.lot_id 
       , date(ld.created_at) ;

if my_err < 0 then
    set v_fail_cnt = 1;
    set v_remark = sqlstates;
else 
    set  v_ok_cnt1 = row_count();
    set  v_remark = '[1-3] end of created aggregate_app_sale';
end if;
set  v_step  = 'End';

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt1,     v_fail_cnt, v_remark,  current_timestamp()
    );
   
 if v_ok_cnt1 = 0 then
        set v_step    = 'End';
        set v_remark  ='[1-4]No data Found';
        insert into aggregate_batch_log  
         ( 
            id ,        proc_name   ,proc_date, proc_step  ,
            ok_cnt,     fail_cnt    ,remark   , create_at)
        VALUES 
         (null, v_proc_id,CURRENT_DATE(), v_step,
          v_ok_cnt1,     v_fail_cnt, v_remark,  current_timestamp()
         );
      commit;
      set output_flag = 'FAIL';
      set output_msg  ='[1-4]No data Found';
      leave proc_return;
      end if;   
   
/**********************************
 * 2. aggregation of customer 
 * *********************************/

select count(*) 
into   v_is_cnt
from   aggregate_customer_sale 
where  aggregate_date = v_date
;
if v_is_cnt > 0 then 
   delete from aggregate_customer_sale 
   where  aggregate_date = v_date
   ;
 set  v_ok_cnt1 = row_count();
 set  v_step    = 'Delete';
 set  v_remark  = concat( arg_date,'[2-1] Delete old aggregate_customer_sale');
 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
       (null, v_proc_id, CURRENT_DATE(), v_step,
          v_ok_cnt1, v_fail_cnt,     v_remark,  current_timestamp()
       );

  end if    
   ;
   
 set  v_ok_cnt2 = 0;
 set  v_step  = 'Start';
 set  v_remark = '[2-2] end of created a aggregate_customer_sale';

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt2,     v_fail_cnt, v_remark,  current_timestamp()
    );

  /***********************************************
 * aggregate customer  
 ***********************************************/
insert into aggregate_customer_sale  
		(lot_id                 , 
		 aggregate_date         ,   
		 customer_id            ,
		 total_qty              ,
		 total_amt              ,
		 digit_2_qty            ,
		 digit_2_amt            ,
		 digit_3_qty            ,
		 digit_3_amt            ,
		 digit_4_qty            ,
		 digit_4_amt            ,
		 digit_5_qty            ,
		 digit_5_amt            ,
		 digit_6_qty            ,
		 digit_6_amt            ,
		 created_at             
		)
select   doi.lot_id as LOT_ID   
       , date(ld.created_at) as aggregate_date 
       , ld.customer_id
       , sum(ldn.money / 1000) as total_qty 
       , sum(ldn.money)        as total_amt 
       , sum(case when ldn.quota_digit_id = 2 then ldn.money/1000 else 0 end) as digit_2_qty 
       , sum(case when ldn.quota_digit_id = 2 then ldn.money      else 0 end) as digit_2_amt 
       , sum(case when ldn.quota_digit_id = 3 then ldn.money/1000 else 0 end) as digit_3_qty 
       , sum(case when ldn.quota_digit_id = 3 then ldn.money      else 0 end) as digit_3_amt 
       , sum(case when ldn.quota_digit_id = 4 then ldn.money/1000 else 0 end) as digit_4_qty 
       , sum(case when ldn.quota_digit_id = 4 then ldn.money      else 0 end) as digit_4_amt 
       , sum(case when ldn.quota_digit_id = 5 then ldn.money/1000 else 0 end) as digit_5_qty 
       , sum(case when ldn.quota_digit_id = 5 then ldn.money      else 0 end) as digit_5_amt 
       , sum(case when ldn.quota_digit_id = 6 then ldn.money/1000 else 0 end) as digit_6_qty 
       , sum(case when ldn.quota_digit_id = 6 then ldn.money      else 0 end) as digit_6_amt 
from lotto_draws ld 
inner join lotto_bill_histories lbh 
      on   ld.id = lbh.lotto_draw_id 
     /* and  lbh.deleted_at  is null 
      and  lbh.lotto_bill_status_id = 2 */
inner join lotto_draws_numbers ldn 
      on   ld.id = ldn.lotto_draw_id 
      /* and ldn.deleted_at is null
         and ldn.status = 2
       */ 
inner join days_of_installments doi 
      on   doi.id = ld.days_of_installment_id  
inner join installments i 
      on   doi.installment_id = i.id 
where ld.deleted_at  is null
/* and   ld.lotto_draw_status_id  = 2 */
and   ld.created_at  >= v_date 
and   ld.created_at  <  date_add(v_date, interval 1 day )
group by doi.lot_id 
       , date(ld.created_at) 
       , ld.customer_id
       ; 	
 set  v_ok_cnt2 = row_count();
 set  v_step  = 'End';
 set  v_remark = '[2-3] end of created a aggregate_customer_sale';

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt2,     v_fail_cnt, v_remark,  current_timestamp()
    );
   
  /*commit 처리  */
  commit;       
  set output_flag = 'SUCCESS';
  set output_msg  = 'End of Success ';

  end proc_return;
  
  END ;;
