CREATE DEFINER=`administrator`@`%` PROCEDURE `sp_aggregate_lotid_dealer`( in  arg_lot_id  varchar(10),
   out output_flag varchar(10) , 
   out output_msg  varchar(200) 
 )
BEGIN
/****************************************************************
* sp_aggregate_lotid_dealer
*  create by sy.park
*  create at 2023.07.18
*****************************************************************/
declare  v_lot_id    varchar(10);
declare  v_is_cnt    integer default 0;
declare  v_ok_cnt1   integer default 0;
declare  v_ok_cnt2   integer default 0;
declare  v_ok_cnt    integer default 0;
declare  v_fail_cnt  integer default 0;
declare  v_proc_id   varchar(50); 
declare  v_step      varchar(10);
declare  v_remark    varchar(500);
declare sql_err int default 0;
declare continue handler for sqlexception set sql_err = -1;

	/* 정산여부 check  */	
	set v_lot_id = arg_lot_id;
    set v_proc_id = 'sp_aggregate_lotid_dealer';
    
  proc_return: begin  
	select   count(*) 
	 into    v_is_cnt
	 from   aggregate_dealer
	 where  lot_id = v_lot_id 
	 and    settlement_yn  = 'Y'
	 ;
    if v_is_cnt > 0 then
      set output_flag = 'FAIL';
      set output_msg  ='It can not re-calculate data that have already been settled. ';
      leave proc_return;
      end if;
 set  v_step = 'Start';
 set  v_remark = '[1-1] create a aggregate_dealer_device';
 
 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt1,     v_fail_cnt, v_remark,  current_timestamp()
    );
 /**********************************
 * 1. 딜러-device_sell_no 단위 집계 
 * *********************************/
 select count(*) 
into   v_is_cnt
from   aggregate_dealer_device 
where  lot_id = v_lot_id
;
if v_is_cnt > 0 then 
   delete from aggregate_dealer_device 
   where lot_id = v_lot_id
   ;
end if    
   ;
   insert into aggregate_dealer_device 
		(lot_id           , 
		 seller_number    ,   
		 device_sell_no   ,   
		 total_qty   ,
		 total_amt   ,
		 digit_2_qty ,
		 digit_2_amt ,
		 digit_3_qty ,
		 digit_3_amt ,
		 digit_4_qty ,
		 digit_4_amt ,
		 digit_5_qty ,
		 digit_5_amt ,
		 digit_6_qty ,
		 digit_6_amt ,
		 due_date    ,
		 create_date , 
		 created_at)  
select    round_id
        , seller_number
        , device_sell_no
        , sum(qty)
        , sum(amount)
        , sum(case when quota_digit_id = 2 then qty else 0 end)    as digit_2_qty 
        , sum(case when quota_digit_id = 2 then amount else 0 end) as digit_2_amt 
        , sum(case when quota_digit_id = 3 then qty else 0 end)    as digit_3_qty 
        , sum(case when quota_digit_id = 3 then amount else 0 end) as digit_3_amt 
        , sum(case when quota_digit_id = 4 then qty else 0 end)    as digit_4_qty 
        , sum(case when quota_digit_id = 4 then amount else 0 end) as digit_4_amt 
        , sum(case when quota_digit_id = 5 then qty else 0 end)    as digit_5_qty 
        , sum(case when quota_digit_id = 5 then amount else 0 end) as digit_4_amt 
        , sum(case when quota_digit_id = 6 then qty else 0 end)    as digit_6_qty 
        , sum(case when quota_digit_id = 6 then amount else 0 end) as digit_6_amt 
        , max(date(doi.end_date_time)) as due_date
        , CURRENT_DATE()
        , CURRENT_TIMESTAMP() 
from    pos_sale_detail psd 
inner join days_of_installments doi 
        on psd.round_id =  doi.lot_id  
where   round_id = v_lot_id
group by round_id
        ,seller_number
        ,device_sell_no
;

set  v_step  = 'End';
if sql_err < 0 then
    set output_flag = 'FAIL';
    set output_msg  ='[1-2]Insert Error:' ||sqlstates;
    leave proc_return;
else 
    set  v_ok_cnt1 = row_count();
    set  v_remark = '[1-2] end of created a aggregate_dealer_device';
end if;

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt1,     v_fail_cnt, v_remark,  current_timestamp()
    );
 
 if v_ok_cnt1 = 0 then
      set output_flag = 'FAIL';
      set output_msg  ='[1-2]No data Found';
      commit;
      leave proc_return;
      end if;

 
/**********************************
 * 2. 딜러단위 집계 
 * *********************************/
select count(*) into v_is_cnt
from aggregate_dealer 
where lot_id = v_lot_id
;

if v_is_cnt > 0 then 
   delete from aggregate_dealer 
   where lot_id = v_lot_id
   ;
end if    
   ;
 set  v_ok_cnt2 = 0;
 set  v_step  = 'Start';
 set  v_remark = '[2-1] end of created a aggregate_dealer';
 
  insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt2,     v_fail_cnt, v_remark,  current_timestamp()
    );
    
  /***********************************************
 * 딜러별 집계 
 ***********************************************/
insert into aggregate_dealer  
		(lot_id                 , 
		 seller_number          ,   
		 total_qty              ,
		 total_amt              ,
		 digit_2_qty            ,
		 digit_2_amt            ,
		 digit_3_qty            ,
		 digit_3_amt            ,
		 digit_4_qty            ,
		 digit_4_amt            ,
		 digit_5_qty            ,
		 digit_5_amt            ,
		 digit_6_qty            ,
		 digit_6_amt            ,
		 basic_rate              ,
		 basic_fee               ,
		 device_all_cnt         ,
		 device_active_cnt      ,
		 device_activity_rate   ,
		 device_avg_amt         ,
		 target_rate       ,
		 target_fee        ,
         on_time_rate,
         on_time_fee,
		 settlement_date        ,
		 settlement_yn          ,
		 create_date            , 
		 created_at             ,
		 updated_at   
		)
select   xx.lot_id  
        ,xx.seller_number 
        ,xx.total_qty 
        ,xx.total_amt 
        ,xx.digit_2_qty 
        ,xx.digit_2_amt
        ,xx.digit_3_qty 
        ,xx.digit_3_amt
        ,xx.digit_4_qty 
        ,xx.digit_4_amt
        ,xx.digit_5_qty 
        ,xx.digit_5_amt
        ,xx.digit_6_qty 
        ,xx.digit_6_amt
        ,case when xx.pv_number = 21  then 20 
              when xx.pv_number != 21 then 20 
                   else 0 end basic_rate
        ,case when xx.pv_number = 21  then xx.total_amt * 0.2  /* vientiance capital : 1% */
              when xx.pv_number != 21 then xx.total_amt * 0.2  /* other province : 1% */
              else 0 end as  basic_amt 
        ,xx.device_all_cnt
        ,xx.device_active_cnt 
        ,xx.acvity_rate 
        ,xx.agent_avg_amt
        ,case when xx.pv_number = 21 and  xx.acvity_rate >= 70 and xx.agent_avg_amt >= 250000 
                   then 1 
              when xx.pv_number != 21 and  xx.acvity_rate >= 70 and xx.agent_avg_amt >= 250000 
                   then 1 
                   else 0 end target_rate
        ,case when xx.pv_number = 21 and  xx.acvity_rate >= 70 and xx.agent_avg_amt >= 250000 
                   then xx.total_amt * 0.01  /* vientiance capital : 1% */
              when xx.pv_number != 21 and  xx.acvity_rate >= 70 and xx.agent_avg_amt >= 250000 
                   then xx.total_amt * 0.01  /* other province : 1% */
              else 0 end as  target_amt 
        ,case when xx.pv_number = 21   then 7 
              when xx.pv_number != 21  then 8 
                   else 0 end on_time_rate
        ,case when xx.pv_number = 21   then xx.total_amt * 0.07  /* vientiance capital : 1% */
              when xx.pv_number != 21  then xx.total_amt * 0.08  /* other province : 1% */
              else 0 end as  on_time_amt 
         ,null
		 ,'N'
		 , CURRENT_DATE()
		 , CURRENT_TIMESTAMP()
		 , CURRENT_TIMESTAMP()
 from (
 select  xa.lot_id  
        ,xa.seller_number 
        ,xb.pv_number
        ,xa.total_qty 
        ,xa.total_amt 
        ,xa.digit_2_qty 
        ,xa.digit_2_amt
        ,xa.digit_3_qty 
        ,xa.digit_3_amt
        ,xa.digit_4_qty 
        ,xa.digit_4_amt
        ,xa.digit_5_qty 
        ,xa.digit_5_amt
        ,xa.digit_6_qty 
        ,xa.digit_6_amt
        ,xb.device_all_cnt
        ,xa.device_active_cnt 
        ,round(xa.device_active_cnt/xb.device_all_cnt*100,1) as acvity_rate 
        ,round(xa.total_amt / xb.device_all_cnt,0) as agent_avg_amt  
from ( select lot_id             as lot_id 
		       ,seller_number     as seller_number
		       ,sum(total_qty)    as total_qty 
		       ,sum(total_amt)    as total_amt 
		       ,sum(digit_2_qty)  as digit_2_qty 
		       ,sum(digit_2_amt)  as digit_2_amt
		       ,sum(digit_3_qty)  as digit_3_qty 
		       ,sum(digit_3_amt)  as digit_3_amt
		       ,sum(digit_4_qty)  as digit_4_qty 
		       ,sum(digit_4_amt)  as digit_4_amt
		       ,sum(digit_5_qty)  as digit_5_qty 
		       ,sum(digit_5_amt)  as digit_5_amt
		       ,sum(digit_6_qty)  as digit_6_qty 
		       ,sum(digit_6_amt)  as digit_6_amt
		       ,count(distinct device_sell_no) device_active_cnt 
       from aggregate_dealer_device ad 
       where lot_id = v_lot_id
	   group by lot_id
	            ,seller_number 
            ) xa             
  inner join (
              select   p.pv_number 
                     , dn.seller_number 
                     , count(*) as device_all_cnt 
              from dealer_numbers dn 
              inner join provinces p 
                    on p.id = dn.province_id 
              inner join dealer_devices dd
                    on   dn.id = dd.dealer_number_id
              where dn.deleted_at is null
              group by p.pv_number, dn.seller_number 
               ) xb 
             on xa.seller_number = xb.seller_number 
           ) xx  ;
 	
 set  v_ok_cnt2 = row_count();
 set  v_step  = 'End';
 set  v_remark = '[2-2] end of created a aggregate_dealer';
  insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt2,     v_fail_cnt, v_remark,  current_timestamp()
    );
  /*commit 처리  */
  commit;       
  set output_flag = 'SUCCESS';
  set output_msg  = 'End of Success';
  end proc_return;
   
    
  END ;;
DELIMITER ;
