CREATE DEFINER=`administrator`@`%` PROCEDURE `sp_aggregate_settlement`( in  arg_lot_id  varchar(10),
   out output_flag varchar(10) , 
   out output_msg  varchar(200) 
 )
BEGIN
/****************************************************************
* sp_aggregate_settlement
*  create by sy.park
*  create at 2023.07.18
*  batch time : 17:30 : Auto batch runs on 0-MONDAY, 2-WEDNESDAY, 4-FRIDAY 
*****************************************************************/
declare  v_lot_id    varchar(10);
declare  v_is_cnt    integer default 0;
declare  v_ok_cnt1   integer default 0;
declare  v_ok_cnt2   integer default 0;
declare  v_ok_cnt    integer default 0;
declare  v_fail_cnt  integer default 0;
declare  v_proc_id   varchar(50); 
declare  v_step      varchar(10);
declare  v_remark    varchar(500);
declare  v_sch_lot_id  varchar(10);
declare  v_week_day  smallint;
declare sql_err int default 0;
declare continue handler for sqlexception set sql_err = -1;
    set v_week_day = weekday(current_date());
	set v_proc_id = 'sp_aggregate_settlement';

   proc_return: begin  
    select xa.lot_id 
    into   v_sch_lot_id  
    from (
			select lot_id
				   ,row_number() over ( order by start_date_time desc) as seq  
    		from   days_of_installments
			where  start_date_time < current_timestamp
    ) xa
    where xa.seq = 2
    ;
    /*****************************************************************
    * Auto batch runs on 0-MONDAY, 2-WEDNESDAY, 4-FRIDAY 
    ********************************************************************/
    if v_week_day not in (0,2,4) and length(arg_lot_id) < 8 then
       set v_remark = concat(v_lot_id, ' AutoBach only runs on Mon, Wed, and Fri. ');
       set v_step   = 'End';
       insert into aggregate_batch_log  
       ( 
          id ,        proc_name   ,proc_date, proc_step  ,
          ok_cnt,     fail_cnt    ,remark   , create_at)
     VALUES 
         (null,       v_proc_id,  CURRENT_DATE(), v_step,
           v_ok_cnt1,  v_fail_cnt, v_remark,       current_timestamp()
          );
        commit;  
        set output_flag = 'FAIL';
        set output_msg  =' AutoBach only runs on Mon, Wed, and Fri. ';
        leave proc_return;
    end if;
    
	set v_lot_id = ifnull(arg_lot_id , v_sch_lot_id);
    
    /* 정산여부 check  */	
	select   count(*) 
	 into    v_is_cnt
	 from    aggregate_settlement
	 where   lot_id = v_lot_id 
	 and     confirmed_yn  = 'Y'
	 ;
    if v_is_cnt > 0 then
      set v_remark = concat(v_lot_id, 'It can not re-calculate data that have already been settled. ');
      set v_step   = 'End';
    insert into aggregate_batch_log  
     ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
     VALUES 
      (null,       v_proc_id,  CURRENT_DATE(), v_step,
       v_ok_cnt1,  v_fail_cnt, v_remark,       current_timestamp()
       );
      set output_flag = 'FAIL';
      set output_msg  ='It can not re-calculate data that have already been settled. ';
      leave proc_return;
      end if;
     
 set  v_step = 'Start';
 set  v_remark = '[1] create a aggregate_settlement';
 
 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
      (null,       v_proc_id,  CURRENT_DATE(), v_step,
       v_ok_cnt1,  v_fail_cnt, v_remark,       current_timestamp()
    );
 /**********************************
 *  aggregate_settlement
 * *********************************/
select count(*) 
into   v_is_cnt
from   aggregate_settlement 
where  lot_id = v_lot_id
;
if v_is_cnt > 0 then 
   delete from aggregate_settlement 
   where lot_id = v_lot_id
   ;
	 set  v_step = 'Delete';
	 set  v_remark = '[2] Delete old aggregate_settlement';
	 
	 insert into aggregate_batch_log  
	   ( 
	       id ,        proc_name   ,proc_date, proc_step  ,
	       ok_cnt,     fail_cnt    ,remark   , create_at)
	  VALUES 
	      (null,       v_proc_id,  CURRENT_DATE(), v_step,
	       v_ok_cnt1,  v_fail_cnt, v_remark,       current_timestamp()
	    ); 
end if    
   ;
   insert into aggregate_settlement 
		(settlement_id  
         ,lot_id        
         ,seller_number   
         ,settlement_date
         ,brought_forward_amt
         ,total_sale_amt     
         ,prize_amt          
         ,prize_tax          
         ,prize_actual       
         ,prize_fee          
         ,basic_fee          
         ,target_fee         
         ,on_time_yn         
         ,on_time_fee          
         ,estimate_amt        
         ,deposit_amt        
         ,difference_amt     
         ,other_deductions_amt 
         ,hold_payments_amt     
         ,carried_forward_amt   
         ,confirmed_yn         
         ,confirmed_date       
         ,created_at            
         ,updated_at
         )
select    NULL
         ,ad.lot_id
         ,ad.seller_number
         ,due.due_date
         ,bf.carried_forward_amt
         ,ad.total_amt 
         ,0 AS prize_amt          
         ,0 AS prize_tax          
         ,0 AS prize_actual       
         ,0 AS prize_fee          
         ,ad.basic_fee          
         ,ad.target_fee         
         , 'Y'
         ,ad.on_time_fee
         ,ad.total_amt + ad.basic_fee + ad.target_fee AS estimate_amt
         ,0 AS deposit_amt
         ,ad.total_amt + ad.basic_fee + ad.target_fee AS difference_amt 
         ,0 AS other_deductions_amt
         ,0 AS hold_payments_amt
         ,bf.carried_forward_amt + ad.total_amt + ad.basic_fee + ad.target_fee AS carried_forward_amt
         ,'N'
         ,NULL
         ,current_timestamp()
         ,current_timestamp()
from    aggregate_dealer ad
INNER JOIN         
        (
		SELECT  doi1.lot_id  as cur_lot_id
		      , doi1.id      as cur_doi_id
		      , doi2.lot_id  as next_lot_id 
		      , doi2.id      as next_doi_id
		      , doi3.lot_id  as bft_lot_id 
		      , doi3.id      as bft_doi_id
		      , row_number() over( order by doi2.start_date_time ,doi3.start_date_time desc) as seq  
		      , date(doi2.end_date_time) as due_date  
		FROM  days_of_installments doi1 
		inner join days_of_installments doi2
		      on doi1.lot_id <  doi2.lot_id 
		inner join days_of_installments doi3
		      on doi1.lot_id >  doi3.lot_id 
		where doi1.lot_id = v_lot_id
      ) due
		ON  ad.lot_id = due.cur_lot_id
		AND due.seq = 1 
LEFT OUTER JOIN aggregate_settlement bf
           ON  bf.lot_id        = due.bft_lot_id 
           AND bf.seller_number = ad.seller_number 
           AND bf.confirmed_yn = 'Y'
where    ad.lot_id = v_lot_id
;

set  v_step  = 'End';
if sql_err < 0 then
    set output_flag = 'FAIL';
    set output_msg  ='[1-2]Insert Error:' ||sqlstates;
else 
    set  v_ok_cnt1 = row_count();
    set  v_remark = '[3] end of created a aggregate_settlement';
end if;

 insert into aggregate_batch_log  
   ( 
       id ,        proc_name   ,proc_date, proc_step  ,
       ok_cnt,     fail_cnt    ,remark   , create_at)
  VALUES 
   (null, v_proc_id,CURRENT_DATE(), v_step,
       v_ok_cnt1,     v_fail_cnt, v_remark,  current_timestamp()
    );
 
 
  /*commit 처리  */
  commit;       
  set output_flag = 'SUCCESS';
  set output_msg  = 'End of Success ';
 
  end proc_return;
   
    
  END ;;
